-- Consulta Original ---------------------
SELECT  
    max(a113.co_ug) AS codigo_unidade,
    max(a113.no_ug) AS nome_unidade,
    max(a114.co_gestao) AS gestao,
    a11.id_documento_ccor_orca AS id_documento_empenho,
    max(a115.no_dia_completo) AS data_emissao_empenho,
    a16.id_entidade_favo_doc AS cpf_cnpj_credor,
    max(a116.no_entidade) AS nome_credor,
    max(a18.co_fonte_recurso_deta) AS fonte_recurso,
    max(a112.co_ptres) AS ptres,
    max(a117.co_modalidade_licitacao_ne) AS codigo_modalidade_licitacao_siafi,
    max(a117.no_modalidade_licitacao_ne) AS nome_modalidade_licitacao_siafi,
    max(a110.co_natureza_despesa) AS codigo_natureza_despesa,
    max(a110.no_natureza_despesa) AS nome_natureza_despesa,
    a11.id_pi AS codigo_plano_interno,
    max(a111.no_pi) AS nome_plano_interno,
    a16.tx_informacao_complementar AS informacao_complementar,
    a16.no_sistema_origem AS sistema_origem,   
    sum(CASE 
        WHEN a12.id_item_informacao = '421'
        THEN (a11.va_movimento_liquido * a12.in_operacao_expressao)
        ELSE 0
    END) AS valor_empenhado,
    sum(CASE 
        WHEN a12.id_item_informacao = '602'
        THEN (a11.va_movimento_liquido * a12.in_operacao_expressao)
        ELSE 0
    END) AS valor_aliquidar,
    sum(CASE 
        WHEN a12.id_item_informacao = '623'
        THEN (a11.va_movimento_liquido * a12.in_operacao_expressao)
        ELSE 0
    END) AS valor_liquidado,
    sum(CASE 
        WHEN a12.id_item_informacao = '423'
        THEN (a11.va_movimento_liquido * a12.in_operacao_expressao)
        ELSE 0
    END) AS valor_pago
FROM dwtg_colunar_vbl.wf_lancamento_ep20 a11
JOIN dwtg_colunar_vbl.wd_item_decodificado_ccon a12 ON (a11.id_ano_lanc = a12.id_ano_item_conta AND a11.id_conta_contabil_lanc = a12.id_conta_contabil)
JOIN dwtg_colunar_vbl.wa_mes_acum a13 ON (a11.id_ano_lanc = a13.id_ano_acum_ano_saldo AND a11.id_mes_lanc = a13.id_mes_acum_ano_saldo)
JOIN dwtg_colunar_vbl.wd_ug_exercicio a14 ON (a11.id_ano_lanc = a14.id_ano AND a11.id_ug_exec = a14.id_ug)
JOIN dwtg_colunar_vbl.wd_orgao a15 ON (a14.id_orgao_ug = a15.id_orgao)
JOIN dwtg_colunar_vbl.wd_doc_ne a16 ON (a11.id_documento_ccor_orca = a16.id_doc_ne)
JOIN dwtg_colunar_vbl.wd_amparo_legal a17 ON (a16.id_amparo_legal = a17.id_amparo_legal)
JOIN dwtg_colunar_vbl.wd_fonte_recurso_deta a18 ON (a11.id_fonte_recurso_deta = a18.id_fonte_recurso_deta)
JOIN dwtg_colunar_vbl.wd_item_informacao a19 ON (a12.id_item_informacao = a19.id_item_informacao)
JOIN dwtg_colunar_vbl.wd_natureza_despesa a110 ON (a11.id_categoria_economica_nade = a110.id_categoria_economica_nade AND a11.id_elemento_despesa_nade = a110.id_elemento_despesa_nade AND a11.id_grupo_despesa_nade = a110.id_grupo_despesa_nade AND a11.id_moap_nade = a110.id_moap_nade)
JOIN dwtg_colunar_vbl.wd_pi a111 ON (a11.id_orgao_pi = a111.id_orgao_pi AND a11.id_pi = a111.id_pi)
JOIN dwtg_colunar_vbl.wd_ptres a112 ON (a11.id_ptres = a112.id_ptres)
JOIN dwtg_colunar_vbl.wd_ug a113 ON (a14.id_ug = a113.id_ug)
JOIN dwtg_colunar_vbl.wd_gestao a114 ON (a15.id_gestao_prin = a114.id_gestao)
JOIN dwtg_colunar_vbl.wd_dia a115 ON (a16.id_ano_emissao_doc = a115.id_ano AND a16.id_dia_emissao_doc = a115.id_dia AND a16.id_mes_emissao_doc = a115.id_mes)
JOIN dwtg_colunar_vbl.wd_entidade a116 ON (a16.id_entidade_favo_doc = a116.id_entidade AND a16.id_tp_entidade_favo_doc = a116.id_tp_entidade)
JOIN dwtg_colunar_vbl.wd_modalidade_licitacao_ne a117 ON (a17.id_modalidade_licitacao_ne = a117.id_modalidade_licitacao_ne)
WHERE ((a13.id_ano = 2022 --YEAR(curdate())
	AND a13.id_mes = 14)
	AND a12.id_item_informacao IN (421, 423, 602, 623)
	AND a16.no_sistema_origem IN ('COMPRASNET CONTRATOS'))
GROUP BY a14.id_ug,
    a15.id_gestao_prin,
    a11.id_documento_ccor_orca,
    a16.id_ano_emissao_doc,
    a16.id_mes_emissao_doc,
    a16.id_dia_emissao_doc,
    a16.id_tp_entidade_favo_doc,
    a16.id_entidade_favo_doc,
    a11.id_fonte_recurso_deta,
    a11.id_ptres,
    a11.id_categoria_economica_nade,
    a11.id_grupo_despesa_nade,
    a11.id_moap_nade,
    a11.id_elemento_despesa_nade,
    a11.id_orgao_pi,
    a11.id_pi,
    a17.id_modalidade_licitacao_ne,
    a16.tx_informacao_complementar,
    a16.no_sistema_origem;

